import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
	width: 100%;
`;

const CurrentNewsContainer = styled.div`
	font-size: 4rem;
`;

const WorldEvents = () => {
	return (
		<Container>
			<h1>World Events</h1>
			<h2>Latest</h2>
			<CurrentNewsContainer>
				Hello this is the current news!
			</CurrentNewsContainer>
			<h2>Pasat</h2>
		</Container>
	);
};

export default WorldEvents;
